import React, { useEffect, createContext, useState } from 'react';
import { Switch, Route } from 'react-router-dom';

export const SettingsContext = createContext();

export function Routing() {                                                                      //routes for the project


    const [settings, setSettings] = useState();
    useEffect(() => {
        axios.post("https://localhost:5000/settingsAPI").then((res) => {
            console.log(res.data);
            setSettings(res.data);
        });
    }, []);

    const testSettings = (settingsChange, value) => {
        var settingsTemp = settings;
        switch (settingsChange) {
            case "Frame Threshold":
                settingsTemp["Frame Threshold"] = parseInt(value);
                break;
            case "Detection Sensitivity":
                settingsTemp["Detection Sensitivity"] = parseFloat(value);
                break;
            // case "LoginLogoutTime":
            //     settingsTemp.Login.hours = parseInt(value.login.hours);
            //     settingsTemp.Login.minutes = parseInt(value.login.minutes);
            //     settingsTemp.Logout.hours = parseInt(value.logout.hours);
            //     settingsTemp.Logout.minutes = parseInt(value.logout.minutes);
            //     break;
            default:
                console.log("which settings called on default: ", settingsChange);
                break;
        }
        setSettings(settingsTemp);
    };








    return (
        <SettingsContext.Provider value={[settings, testSettings]}>
            <div>
                <Switch>
                    <Route path="/" exact component={landing} />
                    <Route path="/underconst" component={underconst} />
                    <Route path="/login" component={login} />
                    <Route path="/admin/login" component={adminlogin} />
                    <Route path="/register" component={Register} />
                    {/* <Route path="/logout" component={logout} /> */}
                    <Route path="/visitor" component={Visitor} />
                    <Route path="/checkin" component={Facialrecog} />                                  {/* /facialrecog */}
                    <Route path="/checkout" component={Facialrecogexit} />                              {/* /facialrecogexit */}
                    <Route path="/exitok" component={Exitok} />
                    <Route path="/admin/register" component={Adminregister} />
                    <Route path="/meetingdetails" component={Meetingdetails} />
                    <Route path="/informed" component={Confirmation} />
                    <Route path="/fetchdetails" component={Fetchdetails} />
                    <Route path="/GovernmentID" component={Govtid} />
                    <Route path="/admin/dashboard" component={Admindashboard} />
                    {/* <Route path="/settings" component={Settings} /> */}
                    {/* <Route path="/threshold" component={Threshold} /> */}
                    {/* <Route path="/sensitivity" component={Sensitivity} /> */}
                    {/* <Route path="/settime" component={Settime} /> */}
                    {/* <Route path="/logs" component={Logs} /> */}
                    <Route path="/visitortrack" component={Visitortracking} />
                    <Route path="/allvisitor" component={TotVisitor} />
                    <Route path="/sd" component={Sd} />
                    <Route path="/Sdtracker" component={Sdtracker} />
                    {/* <Route path="/profile" component={Profile} /> */}
                    {/* <Route path="/mulfil" component={App} /> */}
                    <Route path="/newvisitor" component={Registervisitor} />                   {/* /registervisitor */}
                    <Route path="/newvisitor/checkin" component={Newvisitorcheckin} />
                </Switch>
            </div>
        </SettingsContext.Provider>

    )
}
